import React from "react";
import "./Gallery.css";
import { Container, Row, Col } from "reactstrap";

const Gallery = () => {
  return (
    <>
      <section>
        <Container>
          <Row>
            <Col lg='8'>
            <h2>Mountains</h2></Col>
          </Row>
        </Container>
      </section>
    </>
  );
};

export default Gallery;
